import React from "react";
import { Link } from "react-router-dom";
import "./header.css";

function Header() {
  return (
    <>
      <header className="header">
        <div>
          <h1>
            <>Shoping Cart</>
          </h1>
          <>
            <Link to="/">Home</Link>
          </>
        </div>
        <div>
          <span className="cart">
            <Link to="/cart">Cart</Link>
          </span>
        </div>
      </header>
    </>
  );
}

export default Header;
